  ]
}

export type Subject = 'Science' | 'Maths' | 'Language' | 'History' | 'Coding' | 'Economics' | 'Geography' | 'Finance';

export interface Companion {
  id: string;
  name: string;
  subject: Subject;
  topic: string;
  duration: string;
  colorClass: string;
  icon: string;
  description: string;
}

export interface LessonRecord {
  id: string;
  companionId: string;
  companionName: string;
  topic: string;
  subject: Subject;
  duration: string;
  completedAt: string;
  icon: string;
}

export interface UserProgress {
  lessonsCompleted: number;
  companionsCreated: number;
  history: LessonRecord[];
}

export type AppView = 'dashboard' | 'library' | 'journey' | 'builder' | 'lesson' | 'pricing';

import { GoogleGenAI, Type } from "@google/genai";

const API_KEY = process.env.API_KEY || '';

export const getTutorResponse = async (
  companionName: string, 
  subject: string, 
  topic: string, 
  userMessage: string,
  history: { role: 'user' | 'model'; text: string }[]
) => {
  const ai = new GoogleGenAI({ apiKey: API_KEY });

  const systemInstruction = `
    You are ${companionName}, a friendly and expert AI tutor specialized in ${subject}. 
    The current lesson topic is ${topic}. 
    Your goal is to teach the user in an engaging, interactive, and encouraging way.
    Ask questions to check understanding. Use analogies. Keep responses concise but informative.
    Always stay in character.
  `;

  const chat = ai.chats.create({
    model: 'gemini-3-flash-preview',
    config: {
      systemInstruction,
    },
  });

  // Since we use the newer SDK as instructed, we can't pass history directly in create
  // but we can simulate context by prepending it or using the session.
  // For this implementation, we will send messages sequentially if needed, or just the current.

  const response = await chat.sendMessage({ message: userMessage });
  return response.text;
};

export const generateLessonSummary = async (topic: string, conversation: string) => {
  const ai = new GoogleGenAI({ apiKey: API_KEY });
  const response = await ai.models.generateContent({
    model: 'gemini-3-flash-preview',
    contents: `Summarize this learning session about ${topic} into 3 key takeaways: ${conversation}`,
    config: {
      responseMimeType: "application/json",
      responseSchema: {
        type: Type.OBJECT,
        properties: {
          summary: { type: Type.STRING },
          takeaways: {
            type: Type.ARRAY,
            items: { type: Type.STRING }
          }
        },
        required: ["summary", "takeaways"]
      }
    }
  });
  return JSON.parse(response.text);
};

import React from 'react';

interface ButtonProps extends React.ButtonHTMLAttributes<HTMLButtonElement> {
  variant?: 'primary' | 'secondary' | 'outline';
  size?: 'sm' | 'md' | 'lg';
  fullWidth?: boolean;
}

export const Button: React.FC<ButtonProps> = ({ 
  children, 
  variant = 'primary', 
  size = 'md', 
  fullWidth = false,
  className = '',
  ...props 
}) => {
  const baseStyles = "inline-flex items-center justify-center font-semibold rounded-xl transition-all active:scale-95 disabled:opacity-50 disabled:active:scale-100";

  const variants = {
    primary: "bg-[#FF5C35] text-white hover:bg-[#E64B26] shadow-sm",
    secondary: "bg-white text-gray-900 border-2 border-gray-100 hover:bg-gray-50",
    outline: "bg-transparent border-2 border-[#FF5C35] text-[#FF5C35] hover:bg-[#FF5C35]/5"
  };

  const sizes = {
    sm: "px-4 py-2 text-sm",
    md: "px-6 py-3 text-base",
    lg: "px-8 py-4 text-lg"
  };

  return (
    <button 
      className={`${baseStyles} ${variants[variant]} ${sizes[size]} ${fullWidth ? 'w-full' : ''} ${className}`}
      {...props}
    >
      {children}
    </button>
  );
};

