import React, { useState, useEffect, useRef } from 'react';
import { Mic, MicOff, RotateCcw, X, Send, Play, Pause } from 'lucide-react';
import { Companion, AppView } from '../types';
import { SUBJECT_METADATA } from '../constants';
import { Button } from './Button';
import { getTutorResponse } from '../services/gemini';

interface LessonViewProps {
  companion: Companion;
  onEnd: () => void;
  onNavigate: (view: AppView) => void;
}

export const LessonView: React.FC<LessonViewProps> = ({ companion, onEnd, onNavigate }) => {
  const [isMuted, setIsMuted] = useState(false);
  const [isThinking, setIsThinking] = useState(false);
  const [messages, setMessages] = useState<{ role: 'user' | 'model'; text: string }[]>([]);
  const [inputText, setInputText] = useState('');
  const chatEndRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    // Initial Greeting
    const greet = async () => {
      setIsThinking(true);
      try {
        const welcome = await getTutorResponse(
          companion.name, 
          companion.subject, 
          companion.topic, 
          "Hello! I'm ready to start our lesson. Can you introduce yourself and tell me what you're excited to learn today?",
          []
        );
        setMessages([{ role: 'model', text: welcome || 'Hello! Ready to learn?' }]);
      } catch (e) {
        console.error(e);
      } finally {
        setIsThinking(false);
      }
    };
    greet();
  }, [companion]);

  useEffect(() => {
    chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages, isThinking]);

  const handleSendMessage = async () => {
    if (!inputText.trim() || isThinking) return;

    const userMsg = inputText.trim();
    setInputText('');
    setMessages(prev => [...prev, { role: 'user', text: userMsg }]);
    setIsThinking(true);

    try {
      const response = await getTutorResponse(
        companion.name,
        companion.subject,
        companion.topic,
        userMsg,
        messages
      );
      setMessages(prev => [...prev, { role: 'model', text: response || 'Sorry, I missed that.' }]);
    } catch (err) {
      console.error(err);
    } finally {
      setIsThinking(false);
    }
  };

  return (
    <div className="max-w-6xl mx-auto h-[calc(100vh-160px)] flex flex-col animate-in fade-in duration-700">
      {/* Lesson Header */}
      <div className="bg-white border border-gray-100 rounded-3xl p-6 mb-6 flex items-center justify-between shadow-sm">
        <div className="flex items-center">
          <div className={`w-14 h-14 rounded-2xl ${SUBJECT_METADATA[companion.subject].color} flex items-center justify-center mr-4`}>
             {SUBJECT_METADATA[companion.subject].icon}
          </div>
          <div>
            <div className="flex items-center">
               <h2 className="text-xl font-bold text-gray-900">{companion.name}</h2>
               <span className="ml-3 bg-black text-white text-[10px] font-bold px-2 py-0.5 rounded uppercase">{companion.subject}</span>
            </div>
            <p className="text-sm text-gray-500">Topic: {companion.topic}</p>
          </div>
        </div>
        <div className="text-gray-400 font-bold text-lg">{companion.duration}</div>
      </div>

      {/* Main Lesson Area */}
      <div className="flex-1 grid grid-cols-1 lg:grid-cols-3 gap-6 overflow-hidden">
        {/* Visual/Chat Section */}
        <div className="lg:col-span-2 flex flex-col bg-white border border-gray-100 rounded-3xl overflow-hidden shadow-sm">
          {/* Visual Canvas (Placeholder) */}
          <div className="h-2/5 bg-gray-50 border-b border-gray-100 flex items-center justify-center relative p-8">
             <div className="text-center">
                <div className={`w-24 h-24 rounded-3xl ${SUBJECT_METADATA[companion.subject].color} flex items-center justify-center mx-auto mb-4 floating shadow-lg border-4 border-white`}>
                   {React.cloneElement(SUBJECT_METADATA[companion.subject].icon as React.ReactElement, { className: 'w-12 h-12 text-gray-800' })}
                </div>
                <h3 className="text-2xl font-black text-gray-900">{companion.name}</h3>
             </div>
             <div className="absolute inset-0 pointer-events-none border-[12px] border-orange-500/10 rounded-3xl"></div>
          </div>

          {/* Chat/Transcript Section */}
          <div className="flex-1 p-6 overflow-y-auto space-y-4 scroll-smooth">
            {messages.map((m, idx) => (
              <div key={idx} className={`flex ${m.role === 'user' ? 'justify-end' : 'justify-start'}`}>
                <div className={`max-w-[85%] px-5 py-3 rounded-2xl text-sm leading-relaxed ${
                  m.role === 'user' 
                    ? 'bg-[#FF5C35] text-white rounded-br-none' 
                    : 'bg-gray-100 text-gray-800 rounded-bl-none'
                }`}>
                  {m.text}
                </div>
              </div>
            ))}
            {isThinking && (
               <div className="flex justify-start">
                  <div className="bg-gray-100 px-5 py-3 rounded-2xl rounded-bl-none">
                    <div className="flex space-x-1">
                      <div className="w-1.5 h-1.5 bg-gray-400 rounded-full animate-bounce"></div>
                      <div className="w-1.5 h-1.5 bg-gray-400 rounded-full animate-bounce delay-100"></div>
                      <div className="w-1.5 h-1.5 bg-gray-400 rounded-full animate-bounce delay-200"></div>
                    </div>
                  </div>
               </div>
            )}
            <div ref={chatEndRef} />
          </div>

          {/* Input Area */}
          <div className="p-4 border-t border-gray-100 bg-gray-50/50">
            <div className="relative flex items-center">
               <input 
                type="text" 
                value={inputText}
                onChange={(e) => setInputText(e.target.value)}
                onKeyPress={(e) => e.key === 'Enter' && handleSendMessage()}
                placeholder="Type your question..." 
                className="w-full bg-white border border-gray-200 rounded-2xl py-3 px-5 pr-12 focus:ring-2 focus:ring-orange-500 focus:border-transparent outline-none transition-all shadow-sm"
               />
               <button 
                onClick={handleSendMessage}
                disabled={isThinking || !inputText.trim()}
                className="absolute right-2 p-2 bg-orange-500 text-white rounded-xl hover:bg-orange-600 disabled:opacity-50 transition-colors"
               >
                 <Send className="w-5 h-5" />
               </button>
            </div>
          </div>
        </div>

        {/* Controls Section */}
        <div className="flex flex-col space-y-4">
          <div className="bg-white border border-gray-100 rounded-3xl p-8 flex flex-col items-center justify-center text-center shadow-sm h-full">
            <img 
              src="https://picsum.photos/seed/tutor/200/200" 
              className="w-32 h-32 rounded-3xl object-cover mb-4 border-4 border-white shadow-xl"
              alt="Richie AI"
            />
            <h4 className="text-xl font-bold text-gray-900">Richie</h4>
            <p className="text-gray-400 text-sm mt-1">AI Interactive Model</p>
          </div>

          <div className="grid grid-cols-2 gap-4">
            <button 
              onClick={() => setIsMuted(!isMuted)}
              className="flex flex-col items-center justify-center p-6 bg-white border-2 border-gray-100 rounded-3xl hover:border-orange-500/20 hover:bg-orange-50/50 transition-all group"
            >
              <div className={`p-3 rounded-full mb-2 ${isMuted ? 'bg-red-100 text-red-600' : 'bg-gray-100 text-gray-600'}`}>
                {isMuted ? <MicOff className="w-6 h-6" /> : <Mic className="w-6 h-6" />}
              </div>
              <span className="text-sm font-bold text-gray-700">{isMuted ? 'Unmute' : 'Turn off mic'}</span>
            </button>
            <button className="flex flex-col items-center justify-center p-6 bg-white border-2 border-gray-100 rounded-3xl hover:border-orange-500/20 hover:bg-orange-50/50 transition-all">
              <div className="p-3 bg-gray-100 text-gray-600 rounded-full mb-2">
                <RotateCcw className="w-6 h-6" />
              </div>
              <span className="text-sm font-bold text-gray-700">Repeat</span>
            </button>
          </div>

          <Button 
            variant="primary" 
            size="lg" 
            fullWidth 
            onClick={onEnd}
            className="rounded-3xl !py-5 text-xl font-black shadow-lg shadow-orange-500/20"
          >
            End Lesson
          </Button>
        </div>
      </div>
    </div>
  );
};

import React from 'react';
