import React, { useState } from 'react';
import { Layout } from './components/Layout';
import { Dashboard } from './components/Dashboard';
import { LessonView } from './components/LessonView';
import { MyJourney } from './components/MyJourney';
import { AppView, Companion, UserProgress } from './types';
import { INITIAL_COMPANIONS } from './constants';

const App: React.FC = () => {
  const [activeView, setActiveView] = useState<AppView>('dashboard');
  const [selectedCompanionId, setSelectedCompanionId] = useState<string | null>(null);
  const [userProgress, setUserProgress] = useState<UserProgress>({
    lessonsCompleted: 12,
    companionsCreated: 5,
    history: [
      {
        id: 'h1',
        companionId: '1',
        companionName: 'Neura the Brainy Explorer',
        topic: 'Neural Networks of the Brain',
        subject: 'Science',
        duration: '45 mins',
        completedAt: '2 days ago',
        icon: 'Beaker'
      },
      {
        id: 'h2',
        companionId: '10',
        companionName: 'Algebrina, the Eq Queen',
        topic: 'Solving Linear Equations',
        subject: 'Maths',
        duration: '20 mins',
        completedAt: '3 days ago',
        icon: 'Calculator'
      },
      {
        id: 'h3',
        companionId: '11',
        companionName: 'Luna, Your Grammar Guide',
        topic: 'Mastering Tenses in English',
        subject: 'Language',
        duration: '32 mins',
        completedAt: '1 week ago',
        icon: 'MessageSquare'
      }
    ]
  });

  const handleNavigate = (view: AppView, companionId?: string) => {
    setActiveView(view);
    if (companionId) setSelectedCompanionId(companionId);
  };

  const handleEndLesson = () => {
    // Add logic to save progress if needed
    const comp = INITIAL_COMPANIONS.find(c => c.id === selectedCompanionId);
    if (comp) {
        const newRecord = {
            id: Math.random().toString(),
            companionId: comp.id,
            companionName: comp.name,
            topic: comp.topic,
            subject: comp.subject,
            duration: comp.duration,
            completedAt: 'Just now',
            icon: comp.icon
        };
        setUserProgress(prev => ({
            ...prev,
            lessonsCompleted: prev.lessonsCompleted + 1,
            history: [newRecord, ...prev.history]
        }));
    }
    setActiveView('dashboard');
    setSelectedCompanionId(null);
  };

  const renderContent = () => {
    switch (activeView) {
      case 'dashboard':
        return <Dashboard onNavigate={handleNavigate} recentLessons={userProgress.history.slice(0, 5)} />;
      case 'journey':
        return <MyJourney progress={userProgress} />;
      case 'lesson':
        const comp = INITIAL_COMPANIONS.find(c => c.id === selectedCompanionId) || INITIAL_COMPANIONS[0];
        return <LessonView companion={comp} onEnd={handleEndLesson} onNavigate={handleNavigate} />;
      case 'library':
        return (
          <div className="space-y-8">
            <h1 className="text-3xl font-black">Companion Library</h1>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {INITIAL_COMPANIONS.map(c => (
                    <div key={c.id} className={`${c.colorClass} border-2 border-black/5 p-8 rounded-[40px] shadow-sm flex flex-col h-full`}>
                        <div className="bg-black text-white text-[10px] font-bold px-3 py-1 rounded-full w-fit mb-6 uppercase tracking-widest">{c.subject}</div>
                        <h3 className="text-2xl font-black text-gray-900 mb-2">{c.name}</h3>
                        <p className="text-sm text-gray-500 mb-4 font-medium leading-relaxed">Topic: {c.topic}</p>
                        <p className="text-xs text-gray-400 mb-8 italic">{c.description}</p>
                        <button 
