import { GoogleGenAI, Type } from "@google/genai";

// Fix: Use process.env.API_KEY directly for initialization as per @google/genai coding guidelines.
export const getTutorResponse = async (
  companionName: string, 
  subject: string, 
  topic: string, 
  userMessage: string,
  history: { role: 'user' | 'model'; text: string }[]
) => {
  // Fix: Create instance right before API call to ensure current key is used
  const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });

  const systemInstruction = `
    You are ${companionName}, a friendly and expert AI tutor specialized in ${subject}. 
    The current lesson topic is ${topic}. 
    Your goal is to teach the user in an engaging, interactive, and encouraging way.
    Ask questions to check understanding. Use analogies. Keep responses concise but informative.
    Always stay in character.
  `;

  const chat = ai.chats.create({
    model: 'gemini-3-flash-preview',
    config: {
      systemInstruction,
    },
  });

  // Since we use the newer SDK as instructed, we can't pass history directly in create
  // but we can simulate context by prepending it or using the session.
  // For this implementation, we will send messages sequentially if needed, or just the current.

  const response = await chat.sendMessage({ message: userMessage });
  return response.text;
};

export const generateLessonSummary = async (topic: string, conversation: string) => {
  // Fix: Create instance right before API call
  const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });
  const response = await ai.models.generateContent({
    model: 'gemini-3-flash-preview',
    contents: `Summarize this learning session about ${topic} into 3 key takeaways: ${conversation}`,
    config: {
      responseMimeType: "application/json",
      responseSchema: {
        type: Type.OBJECT,
        properties: {
          summary: { type: Type.STRING },
          takeaways: {
            type: Type.ARRAY,
            items: { type: Type.STRING }
          }
        },
        required: ["summary", "takeaways"]
      }
    }
  });
  return JSON.parse(response.text || '{}');
};

