// Utility functions for audio
function encode(bytes: Uint8Array) {
  let binary = '';
  const len = bytes.byteLength;
  for (let i = 0; i < len; i++) {
    binary += String.fromCharCode(bytes[i]);
  }
  return btoa(binary);
}

function decode(base64: string) {
  const binaryString = atob(base64);
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}

async function decodeAudioData(
  data: Uint8Array,
  ctx: AudioContext,
  sampleRate: number,
  numChannels: number,
): Promise<AudioBuffer> {
  const dataInt16 = new Int16Array(data.buffer);
  const frameCount = dataInt16.length / numChannels;
  const buffer = ctx.createBuffer(numChannels, frameCount, sampleRate);

  for (let channel = 0; channel < numChannels; channel++) {
    const channelData = buffer.getChannelData(channel);
    for (let i = 0; i < frameCount; i++) {
      channelData[i] = dataInt16[i * numChannels + channel] / 32768.0;
    }
  }
  return buffer;
}

export const LessonView: React.FC<LessonViewProps> = ({ companion, onEnd, onNavigate }) => {
  const [isLiveMode, setIsLiveMode] = useState(false);
  const [isMuted, setIsMuted] = useState(false);
  const [isThinking, setIsThinking] = useState(false);
  const [messages, setMessages] = useState<{ role: 'user' | 'model'; text: string }[]>([]);
  const [inputText, setInputText] = useState('');
  const [transcription, setTranscription] = useState('');

  const chatEndRef = useRef<HTMLDivElement>(null);
  const liveSessionRef = useRef<any>(null);
  const audioContextRef = useRef<AudioContext | null>(null);
  const nextStartTimeRef = useRef<number>(0);
  const sourcesRef = useRef<Set<AudioBufferSourceNode>>(new Set());

  useEffect(() => {
    // Initial Greeting via Chat API
    const greet = async () => {
      setIsThinking(true);
      try {
        const customPrompt = companion.id === 'hausa-tutor' ? HAUSA_TEACHER_PROMPT : '';
        const welcome = await getTutorResponse(
          companion.name, 
          companion.subject, 
          companion.topic, 
          "Barka da zuwa! Hello! I'm ready to start our lesson. Can you tell me what you're excited to learn today?",
          [],
          customPrompt
        );
        setMessages([{ role: 'model', text: welcome || 'Hello! Ready to learn?' }]);
      } catch (e) {
        console.error(e);
      } finally {
        setIsThinking(false);
      }
    };
    greet();

    return () => {
      if (liveSessionRef.current) {
        liveSessionRef.current.close();
      }
    };
  }, [companion]);

  useEffect(() => {
    chatEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  }, [messages, isThinking, transcription]);

  const handleSendMessage = async () => {
    if (!inputText.trim() || isThinking) return;

    const userMsg = inputText.trim();
    setInputText('');
    setMessages(prev => [...prev, { role: 'user', text: userMsg }]);
    setIsThinking(true);

    try {
      const customPrompt = companion.id === 'hausa-tutor' ? HAUSA_TEACHER_PROMPT : '';
      const response = await getTutorResponse(
        companion.name,
        companion.subject,
        companion.topic,
        userMsg,
        messages,
        customPrompt
      );
      setMessages(prev => [...prev, { role: 'model', text: response || 'Yi hakuri, ban gane ba. (Sorry, I didn\'t catch that.)' }]);
    } catch (err) {
      console.error(err);
    } finally {
      setIsThinking(false);
    }
  };

  const toggleLiveMode = async () => {
    if (isLiveMode) {
      if (liveSessionRef.current) liveSessionRef.current.close();
      setIsLiveMode(false);
      return;
    }

    try {
      const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });
      const inputCtx = new (window.AudioContext || (window as any).webkitAudioContext)({ sampleRate: 16000 });
      const outputCtx = new (window.AudioContext || (window as any).webkitAudioContext)({ sampleRate: 24000 });
      audioContextRef.current = outputCtx;

      const stream = await navigator.mediaDevices.getUserMedia({ audio: true });

      const systemInstruction = companion.id === 'hausa-tutor' 
        ? HAUSA_TEACHER_PROMPT 
        : `You are ${companion.name}, a helpful AI tutor for ${companion.subject}. Topic: ${companion.topic}. Keep it educational and interactive.`;

      const sessionPromise = ai.live.connect({
        model: 'gemini-2.5-flash-native-audio-preview-12-2025',
        callbacks: {
          onopen: () => {
            setIsLiveMode(true);
            const source = inputCtx.createMediaStreamSource(stream);
            const scriptProcessor = inputCtx.createScriptProcessor(4096, 1, 1);
            scriptProcessor.onaudioprocess = (e) => {
              if (isMuted) return;
              const inputData = e.inputBuffer.getChannelData(0);
              const l = inputData.length;
              const int16 = new Int16Array(l);
              for (let i = 0; i < l; i++) {
                int16[i] = inputData[i] * 32768;
              }
              const pcmBlob = {
                data: encode(new Uint8Array(int16.buffer)),
                mimeType: 'audio/pcm;rate=16000',
              };
              sessionPromise.then(session => session.sendRealtimeInput({ media: pcmBlob }));
            };
            source.connect(scriptProcessor);
            scriptProcessor.connect(inputCtx.destination);
          },
          onmessage: async (message: LiveServerMessage) => {
            const audioData = message.serverContent?.modelTurn?.parts[0]?.inlineData?.data;
            if (audioData) {
              nextStartTimeRef.current = Math.max(nextStartTimeRef.current, outputCtx.currentTime);
              const buffer = await decodeAudioData(decode(audioData), outputCtx, 24000, 1);
              const source = outputCtx.createBufferSource();
              source.buffer = buffer;
              source.connect(outputCtx.destination);
              source.start(nextStartTimeRef.current);
              nextStartTimeRef.current += buffer.duration;
              sourcesRef.current.add(source);
              source.onended = () => sourcesRef.current.delete(source);
            }

            if (message.serverContent?.outputTranscription) {
              setTranscription(prev => prev + message.serverContent.outputTranscription.text);
            }
            if (message.serverContent?.turnComplete) {
              setMessages(prev => [...prev, { role: 'model', text: transcription }]);
              setTranscription('');
            }
            if (message.serverContent?.interrupted) {
              sourcesRef.current.forEach(s => s.stop());
              sourcesRef.current.clear();
              nextStartTimeRef.current = 0;
            }
          },
          onclose: () => setIsLiveMode(false),
          onerror: (e) => console.error("Live Error:", e),
        },
        config: {
          responseModalities: [Modality.AUDIO],
          speechConfig: {
            voiceConfig: { prebuiltVoiceConfig: { voiceName: 'Kore' } },
          },
          systemInstruction,
          outputAudioTranscription: {},
        }
      });

      liveSessionRef.current = await sessionPromise;
    } catch (err) {
      console.error("Failed to start live session:", err);
      alert("Microphone access is required for live voice interaction.");
    }
  };

  return (
    <div className="max-w-6xl mx-auto h-[calc(100vh-160px)] flex flex-col animate-in fade-in duration-700">
      {/* Lesson Header */}
      <div className="bg-white border border-gray-100 rounded-3xl p-6 mb-6 flex items-center justify-between shadow-sm">
        <div className="flex items-center">
          <div className={`w-14 h-14 rounded-2xl ${SUBJECT_METADATA[companion.subject].color} flex items-center justify-center mr-4`}>
             {SUBJECT_METADATA[companion.subject].icon}
          </div>
          <div>
            <div className="flex items-center">
               <h2 className="text-xl font-bold text-gray-900">{companion.name}</h2>
               <span className="ml-3 bg-black text-white text-[10px] font-bold px-2 py-0.5 rounded uppercase">{companion.subject}</span>
            </div>
            <p className="text-sm text-gray-500">Topic: {companion.topic}</p>
          </div>
        </div>

        <div className="flex items-center space-x-4">
           {isLiveMode && (
             <div className="flex items-center bg-red-50 text-red-600 px-4 py-2 rounded-full text-xs font-black uppercase animate-pulse">
                <Waves className="w-4 h-4 mr-2" /> Live Session
             </div>
           )}
           <div className="text-gray-400 font-bold text-lg hidden md:block">{companion.duration}</div>
        </div>
      </div>

      {/* Main Lesson Area */}
      <div className="flex-1 grid grid-cols-1 lg:grid-cols-3 gap-6 overflow-hidden">
        {/* Visual/Chat Section */}
        <div className="lg:col-span-2 flex flex-col bg-white border border-gray-100 rounded-3xl overflow-hidden shadow-sm">
          {/* Visual Canvas (Placeholder) */}
          <div className={`h-2/5 ${isLiveMode ? 'bg-orange-500' : 'bg-gray-50'} border-b border-gray-100 flex items-center justify-center relative p-8 transition-colors duration-500`}>
             <div className="text-center z-10">
                <div className={`w-24 h-24 rounded-[32px] ${isLiveMode ? 'bg-white' : SUBJECT_METADATA[companion.subject].color} flex items-center justify-center mx-auto mb-4 floating shadow-2xl border-4 border-white`}>
                   {React.cloneElement(SUBJECT_METADATA[companion.subject].icon as React.ReactElement, { 
                     className: `w-12 h-12 ${isLiveMode ? 'text-orange-600' : 'text-gray-800'}` 
